import Link from 'next/link';

export const Header = () => (
  <header>
    <div className="bar">
      Sick fits Nav
      <Link href="/"> Sick fits</Link>
    </div>
    <div className="sub-bar" />

    <p>UI am the header</p>
  </header>
);
